window.bookSummaryJSON = "<p>When I disappeared out of Lina Guardia’s life years ago, it was for her own good. </p> <p>Now our paths cross again. But things are different. </p> <p>She’s got secrets. Dangerous ones. </p> <p>She thinks she can keep me out of her world, but she's in over her head and needs a protector. </p> <p>I just have to remember I can’t be more than that to her. I can’t give in to the temptation. </p> <p><b>Author’s note: </b><i>Corruptible </i>was originally published with the title <i>Disgraced</i>.</p>"; 
